import ReactDOM from 'react-dom';
import React, { useEffect, useState } from 'react';
import { Button, Checkbox, Form } from 'semantic-ui-react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import DataTable from "react-data-table-component";


export default function ReadItems() {


   
// Define the structure of your data
interface ItemData {
  id: number;
  title: string;
  year: number;
}

// Sample data
const data: ItemData[] = [
  { id: 1, title: 'Item 1', year: 2020 },
  { id: 2, title: 'Item 2', year: 2021 },
  { id: 3, title: 'Item 3', year: 2019 },
  { id: 4, title: 'Item 4', year: 2022 },
];

// Define columns for the DataTable
const columns = [
  {
    name: 'ID',
    selector: (row: ItemData) => row.id, // Type explicitly set for 'row'
    sortable: true,
  },
  {
    name: 'Title',
    selector: (row: ItemData) => row.title, // Type explicitly set for 'row'
    sortable: true,
  },
  {
    name: 'Year',
    selector: (row: ItemData) => row.year, // Type explicitly set for 'row'
    sortable: true,
  },
];


    return (
    <div className="container mt-5">
    <div className="row justify-content-center">
    <div className="col-md-12">
    <h2 className="text-center">Register</h2>
     <DataTable
        title="Items List"
        columns={columns}
        data={data}
        pagination
        selectableRows
        highlightOnHover
      />
    
    
    </div>
    </div>
    </div>)	

}
